import React from 'react';
import {Text, View, StyleSheet, Image, SafeAreaView} from 'react-native';
import {Card} from 'antd';
import {PrimaryButton} from '../assets/components/button';
import COLORS from '../assets/components/color';

export default function OnBoard() {
    return (
    <SafeAreaView>
        <View style={style.homes}>
            <Image source={require('../assets/green.png')}/>
            <Card>
                <View style={style.containerfluid}>
                    <View style={style.content}>
                        <Text style={{fontSize: 65, fontWeight: 'bold', color: COLORS.primary}}>Find Your Needs</Text>
                        <View style={style.btnHolder}>
                            <PrimaryButton>Shop Now</PrimaryButton>
                        </View>
                    </View>
                </View>
            </Card>
        </View>
    </SafeAreaView>
    );
};

const style = StyleSheet.create({
    homes: {

    },
    containerfluid: {
    
    },
    content: {

    },
    btnHolder: {

    }
})
